    event.preventDefault();
    let audioCtx = new AudioContext();
    let track = props.audios[0].audio;
    console.log(track);
  }

  return (
    <div className='phonetic2'>
      <button
        role='switch'
        aria-checked='false'
        data-power='on'
        onClick={playAudio}>
        <span>On/Off</span>
      </button>
    </div>
  );
}
